webpackJsonp([1917],{"./node_modules/json-loader/index.js!./.cache/json/articles-certificates-profile-lookup.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/triangular_flag_on_post.png?v=3" alt=":triangular_flag_on_post:" title=":triangular_flag_on_post:"> Remember to use <a><strong><code>Read-Search-Ask</code></strong></a> if you get stuck. Try to pair program <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/busts_in_silhouette.png?v=3" alt=":busts_in_silhouette:" title=":busts_in_silhouette:"> and write your own code <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/pencil.png?v=3" alt=":pencil:" title=":pencil:"></p>\n<h3><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/checkered_flag.png?v=3" alt=":checkered_flag:" title=":checkered_flag:"> Problem Explanation:</h3>\n<p>We have an array of objects representing different people in our contacts lists.</p>\n<p>A <code>lookUpProfile()</code> function that takes <strong>firstName</strong> and a property (<strong>prop</strong>) as arguments has been pre-written for you.</p>\n<p>The function should check if <strong>firstName</strong> is an actual contact\'s <strong>firstName</strong> and the given property (<strong>prop</strong>) is a property of that contact.</p>\n<p>If both are true, then return the <em>value</em> of that property.</p>\n<p>If <strong>firstName</strong> does not correspond to any contacts then return <code>No such contact</code>.</p>\n<p>If <strong>prop</strong> does not correspond to any valid properties then return <code>No such property</code>.</p>\n<ul>\n<li>Change the code below <code>// Only change code below this line</code> and up to <code>// Only change code above this line</code>.</li>\n<li>\n<p>Ensure that you are editing the inside of the <code>lookUpProfile()</code> function.</p>\n<ul>\n<li>This function includes two parameters, <strong>firstName</strong> and <strong>prop</strong>.</li>\n</ul>\n</li>\n<li>\n<p>The function should look through the <strong>contacts</strong> list for the given <strong>firstName</strong> parameter.</p>\n<ul>\n<li>If there is a match found, the function should then look for the given <strong>prop</strong> parameter.</li>\n<li>If both <strong>firstName</strong> and the associated <strong>prop</strong> are found, you should return the value of the <strong>prop</strong>.</li>\n<li>If <strong>firstName</strong> is found and no associated <strong>prop</strong> is found, you should return <code>No such property</code>.</li>\n</ul>\n</li>\n<li>If <strong>firstName</strong> isn\'t found anywhere, you should return <code>No such contact</code>.</li>\n</ul>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href="http://www.freecodecamp.com/challenges/accessing-objects-properties-with-bracket-notation">Challenge: Accessing Objects Properties with Bracket Notation</a></li>\n<li><a href="http://www.freecodecamp.com/challenges/iterate-with-javascript-for-loops">Challenge: Iterate with JavaScript For Loops</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 1</h2>\n<p>Use a <code>for</code> loop to cycle through the <strong>contacts</strong> list.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 2</h2>\n<p>Use a nested <code>if</code> statement to first check if the <strong>firstName</strong> matches, and then checks <code>if</code> the <strong>prop</strong> matches.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 3</h2>\n<p>Leave your <code>return "No such contact"</code> out of the <code>for</code> loop as a final catch-all.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2>Spoiler Alert!</h2>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/2/2d6c412a50797771301e7ceabd554cef4edcd74d.gif" alt="687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif"></p>\n<p><strong>Solution ahead!</strong></p>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/beginner.png?v=3" alt=":beginner:" title=":beginner:"> Basic Code Solution:</h2>\n<pre><code>for (var x = 0; x &#x3C; contacts.length; x++){\n    if (contacts[x].firstName === firstName) {\n        if (contacts[x].hasOwnProperty(prop)) {\n            return contacts[x][prop];\n        } else {\n            return "No such property";\n        }\n    }\n}\nreturn "No such contact";\n</code></pre>\n<h3>Code Explanation:</h3>\n<ul>\n<li>The <code>for</code> loop runs, starting at the first object in the <strong>contacts</strong> list.</li>\n<li>If the <strong>firstName</strong> parameter passed into the function matches the value of the <code>"firstName"</code> key in the first object, the <code>if</code> statement passes.</li>\n<li>\n<p>Then, we use <code>.hasOwnProperty()</code> method (checks if there\'s a given property and returns a boolean) with <strong>prop</strong> as an argument. If it\'s true, the value of <strong>prop</strong> is returned.</p>\n<ul>\n<li>If the second <code>if</code> statement fails, <code>No such property</code> is returned.</li>\n</ul>\n</li>\n<li>If the first <code>if</code> statement fails, the <code>for</code> loop continues on to the next object in the <strong>contacts</strong> list.</li>\n<li>If the <strong>firstName</strong> parameter isn\'t matched by the final <strong>contacts</strong> object, the <code>for</code> loop exits and <code>No such contact</code> is returned.</li>\n</ul>\n<p><strong>Example Run</strong></p>\n<ul>\n<li><code>lookUpProfile("Akira","likes");</code> runs.</li>\n<li><code>"Akira"</code> is matched to the <code>"firstName"</code> key in the first object, so the <code>if</code> statement returns true.</li>\n<li><code>"likes"</code> is found within the first object, so the second <code>if</code> statement returns true.</li>\n<li>The value of <code>"likes"</code> is returned - <code>"Pizza", "Coding", "Brownie Points"</code>.</li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/clipboard.png?v=3" alt=":clipboard:" title=":clipboard:"> NOTES FOR CONTRIBUTIONS:</h2>\n<ul>\n<li><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong>DO NOT</strong> add solutions that are similar to any existing solutions. If you think it is <strong><em>similar but better</em></strong>, then try to merge (or replace) the existing similar solution.</li>\n<li>Add an explanation of your solution.</li>\n<li>Categorize the solution in one of the following categories â€” <strong>Basic</strong>, <strong>Intermediate</strong> and <strong>Advanced</strong>. <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/traffic_light.png?v=3" alt=":traffic_light:" title=":traffic_light:"></li>\n<li>Please add your username only if you have added any <strong>relevant main contents</strong>. (<img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong><em>DO NOT</em></strong> <em>remove any existing usernames</em>)</li>\n</ul>\n<blockquote>\n<p>See <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=3" alt=":point_right:" title=":point_right:"> <a><strong><code>Wiki Challenge Solution Template</code></strong></a> for reference.</p>\n</blockquote>',frontmatter:{title:"Profile Lookup",parent:"/home/stuart/guides/src/pages/articles/certificates/profile-lookup/index.md absPath of file"}}},pathContext:{slug:"/articles/certificates/profile-lookup/"}}}});
